import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import { useApp } from '../../context/AppContext';
import { reviewAPI, enquiryAPI } from '../../services/api';
import './UserPanel.css';

const UserDashboard = () => {
  const { user } = useAuth();
  const { addAlert } = useApp();
  const [userReviews, setUserReviews] = useState([]);
  const [userEnquiries, setUserEnquiries] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchUserData();
  }, [user]);

  const fetchUserData = async () => {
    try {
      // These would be actual API calls to get user-specific data
      // For now, we'll simulate with empty arrays since this data
      // would come from user-specific endpoints
      setUserReviews([]);
      setUserEnquiries([]);
    } catch (error) {
      addAlert({
        type: 'error',
        message: 'Failed to load user data'
      });
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="user-container">
        <div className="loading">Loading your dashboard...</div>
      </div>
    );
  }

  return (
    <div className="user-container">
      <div className="dashboard-header">
        <h1>Welcome back, {user?.name}!</h1>
        <p>Here's your activity and saved institutions</p>
      </div>

      {/* Quick Stats */}
      <div className="stats-grid-user">
        <div className="stat-card-user">
          <div className="stat-icon-user primary">
            <i className="fas fa-star"></i>
          </div>
          <div className="stat-info-user">
            <h3>{userReviews.length}</h3>
            <p>Reviews Written</p>
          </div>
        </div>

        <div className="stat-card-user">
          <div className="stat-icon-user success">
            <i className="fas fa-envelope"></i>
          </div>
          <div className="stat-info-user">
            <h3>{userEnquiries.length}</h3>
            <p>Enquiries Sent</p>
          </div>
        </div>

        <div className="stat-card-user">
          <div className="stat-icon-user warning">
            <i className="fas fa-heart"></i>
          </div>
          <div className="stat-info-user">
            <h3>0</h3>
            <p>Saved Institutes</p>
          </div>
        </div>
      </div>

      {/* Recent Activity */}
      <div className="dashboard-grid-user">
        {/* Recent Reviews */}
        <div className="dashboard-card-user">
          <div className="card-header-user">
            <h3>Your Recent Reviews</h3>
            <Link to="/institutes" className="btn btn-sm btn-primary">
              Write New Review
            </Link>
          </div>
          <div className="card-content-user">
            {userReviews.length > 0 ? (
              <div className="activity-list-user">
                {userReviews.slice(0, 5).map(review => (
                  <div key={review._id} className="activity-item-user">
                    <div className="activity-info-user">
                      <h4>{review.institute?.name}</h4>
                      <div className="rating-stars">
                        {'★'.repeat(review.rating)}{'☆'.repeat(5 - review.rating)}
                      </div>
                      <p>{review.reviewText}</p>
                      <span className="activity-time">
                        {new Date(review.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            ) : (
              <div className="no-data-user">
                <i className="fas fa-star"></i>
                <p>You haven't written any reviews yet</p>
                <Link to="/institutes" className="btn btn-primary btn-sm">
                  Browse Institutes
                </Link>
              </div>
            )}
          </div>
        </div>

        {/* Recent Enquiries */}
        <div className="dashboard-card-user">
          <div className="card-header-user">
            <h3>Your Recent Enquiries</h3>
            <Link to="/institutes" className="btn btn-sm btn-primary">
              Send New Enquiry
            </Link>
          </div>
          <div className="card-content-user">
            {userEnquiries.length > 0 ? (
              <div className="activity-list-user">
                {userEnquiries.slice(0, 5).map(enquiry => (
                  <div key={enquiry._id} className="activity-item-user">
                    <div className="activity-info-user">
                      <h4>{enquiry.institute?.name}</h4>
                      <p>{enquiry.message}</p>
                      <span className="activity-time">
                        {new Date(enquiry.createdAt).toLocaleDateString()}
                      </span>
                      <span className={`status-badge ${enquiry.status}`}>
                        {enquiry.status}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            ) : (
              <div className="no-data-user">
                <i className="fas fa-envelope"></i>
                <p>You haven't sent any enquiries yet</p>
                <Link to="/institutes" className="btn btn-primary btn-sm">
                  Contact Institutes
                </Link>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="quick-actions-user">
        <h3>Quick Actions</h3>
        <div className="actions-grid">
          <Link to="/institutes" className="action-card">
            <i className="fas fa-search"></i>
            <span>Browse Institutes</span>
          </Link>
          <Link to="/institutes" className="action-card">
            <i className="fas fa-star"></i>
            <span>Write a Review</span>
          </Link>
          <Link to="/institutes" className="action-card">
            <i className="fas fa-envelope"></i>
            <span>Send Enquiry</span>
          </Link>
          <Link to="/profile" className="action-card">
            <i className="fas fa-user"></i>
            <span>Update Profile</span>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
